def get_nodewithidforfeature(features, seacrh_id: int):
    for feature in features:
        try:
            props = feature["properties"]
            nodeid = props["id"]
            if seacrh_id == nodeid:
                geometry = feature["geometry"]#{"type": "Point", "coordinates
                coordinates = geometry["coordinates"]
                return coordinates

        except KeyError:
            pass

def printconnectedness(key: int):
    features = filescollection[key]
    cum_length = 0
    for feature in features:
        try:
            props = feature["properties"]
            endid = props["endId"]
            startid = props["startId"]
            segment = props["id"]
            length = props["length"]
            cum_length = cum_length + length
            print('start node-: ', startid, ', end node-: ', endid, ', length of seg-: ', length, ', cum length of lane-: ', cum_length,  ', seg id-: ', segment)
        except KeyError:
            pass

def printcoordinates(key: int):
    features = filescollection[key]
    for feature in features:
        try:
            props = feature["properties"]
            endid = props["endId"]
            startid = props["startId"]
            segment = props["id"]
            start = get_nodewithidforfeature(features, startid)
            end = get_nodewithidforfeature(features, endid)
            print('start node-: (', start[0], ', ', start[1], '), end node-: (',  end[0], ', ', end[1], '), seg id-: ', segment)
        except KeyError:
            pass


